import React from 'react';

interface Props {
  todo: Array<Todo>;
  input: Number;
}

export const TodoListItem:React.FC<Props> = ({ todo, input }) => {
	const checkList: any = todo.filter(obj => { return obj.month === 1 })
  return 
  <div>{checkList.text}</div>
};
